import React from "react";
import ReactDOM from "react-dom";
import Button from "./Button";

const TodoList = () => {
  return (
    <>
      <Button
        type="submit"
        className="btn btn__primary btn__lg"
        ariaPressed="false"
      ></Button>
    </>
  );
};

export default TodoList;
